import React from 'react';
import PropTypes from 'prop-types';
import { connect } from 'react-redux';

export class ItemNav extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
    }
  }

  render() {
    return (
      <div>
        <nav>
          {this.props.username ?
            <button className="top-nav-link" onclick="window.location.href=`/?username=${this.props.username}`;">
              <em>Load Items</em>
            </button>
            :
            <span className="top-nav-link">
              <em>You are not logged in.</em>
            </span>
          }
        </nav>
      </div>
    )
  }
}

ItemNav.propTypes = {
  username: PropTypes.string,
  websceneItems: PropTypes.array
}

ItemNav.defaultProps = {
  username: null,
  websceneItems: [],
};

const mapStateToProps = ({ user: { username, websceneItems } }) => ({
  username,
  websceneItems,
})

export default connect(mapStateToProps)(ItemNav)
